An intimate half-hour of Jeff Lynne and long-time collaborator Richard Tandy on 
piano, playing acoustic versions of many of Jeff's greatest songs including such 
ELO hits as Evil Woman, Telephone Line and Showdown. Filmed in Lynne's LA studio 
and a companion piece to the Mr Blue Sky documentary.

